import React from 'react';
import '../../asset/CSS/Main.css';
import axios from 'axios';
const DangKy_ = () => {
    const [gmail, setgmail] = React.useState('');
    const [pass, setpass] = React.useState('');
    const [sdt, setsdt] = React.useState('');
    const isChangegmail = val => setgmail(val.target.value);
    const isChangepass = val => setpass(val.target.value);
    const isChangesdt = val => setsdt(val.target.value);
    const [err, seterr] = React.useState('');
    const handleClick = e => {
        e.preventDefault();
    }
    const onSubmitDangKy = () => {
        handleClick();
        let dulieu = {gmail: gmail, pass: pass, sdt: sdt }
        axios.post('http://localhost:5000/dangky', dulieu).then(function (response) {
            alert(response.data);
            setgmail('');
            setsdt('');
            setpass('');
        }).catch(function (error) {
            seterr(error);
        });
    }
    return (
        <div>
            <div className="container">
                <div className="row">
                    <div className="col-lg-6" style={{ margin: 'auto' }}>
                        {
                            err != '' ?  <div class="alert alert-danger" role="alert">
                            <strong>{err}</strong>
                        </div> : <div/>
                        }
                       
                        <form action="/action_page_binary.asp" method="post">
                            <div className="form-group">
                                <input type="email" onChange={(val) => isChangegmail(val)} className="form-control input" name="email" id aria-describedby="emailHelpId" placeholder="Nhập email" />
                            </div>
                            <div className="form-group">
                                <input type="text" onChange={(val) => isChangesdt()} className="form-control input" name="sdt" id placeholder="Nhập Số điện Thoại" />
                            </div>
                            <div className="form-group">
                                <input type="password" onChange={(val) => isChangepass()} className="form-control input" name="password" id placeholder="Nhập Mật Khẩu" />
                            </div>
                            <div className="form-group">
                                <input type="password" onChange={() => isChangepass()} className="form-control input" name="password" id placeholder="Nhập lại Mật Khẩu" />
                            </div>
                            <input name="submit" onClick={() => onSubmitDangKy()} className="btn btn-success submit" type="submit" defaultValue="Đăng Nhập" />
                        </form>
                    </div>
                </div>
            </div>

        </div>
    );
}
export default DangKy_;
